sys_variable_value.value:
(function execute(inputs, outputs) {
  var variables = inputs.variables;
  var RITM = inputs.ritm;
  var variableSysIdArray = [];
  while (variables.next()){
    var varName = variables.name;
    var varVal = RITM.variables[varName].toString();
    gs.info('Variable ' + varName + ': ' + varVal);
    if(varVal != 'undefined' &&(varVal == 'True' || varVal == 'true')){
      variableSysIdArray.push(variables.sys_id.toString());
    }
  }

  //Build final query with true variables
  var variableQuery = '';
  for(var i = 0; i<variableSysIdArray.length; i++){
    var currentVariable = variableSysIdArray[i];
    if(!gs.nil(variableQuery)){
      variableQuery += '^OR';
    }
    variableQuery += 'sys_id=' + currentVariable;
  }
  if (gs.nil(variableQuery)){
    variableQuery = 'order=0^order=1';
  }
  var variableGr = new GlideRecord('item_option_new');
  variableGr.addQuery(variableQuery);
  variableGr.query();
  outputs.count = variableGr.getRowCount().toString();
  outputs.variables = variableGr;
})(inputs, outputs);

